import style from "./Header.module.css";
function Header() {
  return (
    <header className={style.header}>
      <div className={style.title}>GreenCosmic Study</div>
      <div className={style.buttonsContainer}>
        <div>All Courses</div>
        <div>My Courses</div>
      </div>
      <div>
        <div></div>
      </div>
    </header>
  );
}
export default Header;
